css:
.github-Tabs .badge .icon:before,
.github-PrPaneItem .badge .icon:before,
.tooltip .badge .icon:before {
  vertical-align: text-top;
}
.github-DotComMarkdownHtml .task-list-item {
  list-style: none;
}
.github-DotComMarkdownHtml .task-list-item .task-list-item-checkbox {
  position: absolute;
  margin-left: -20px;
}
.issueish-badge,
.issueish-badge.badge {
  align-self: flex-start;
  flex-shrink: 0;
  margin-right: 12px;
  font-weight: bold;
  text-transform: capitalize;
  border-radius: 4px;
}
.issueish-badge.open,
.issueish-badge.badge.open {
  color: white;
  background-color: #28a745;
}
.issueish-badge.closed,
.issueish-badge.badge.closed {
  color: white;
  background-color: #dc3545;
}
.issueish-badge.merged,
.issueish-badge.badge.merged {
  color: white;
  background-color: #6f42c1;
}
.status-warning {
  color: #ffd93d;
}
.status-success {
  color: #28a745;
}
.status-error {
  color: #dc3545;
}
